import React, {useState} from "react";

function UseState() {
  const [title, setTitle] = useState("Default title");
  const changeTitle = () => {
    setTitle("Title changer")
    console.log(title);
  };
  return (
    <div className="mx-auto">
      <h1>{title}</h1>
      <h2>{title}</h2>
      <h3>{title}</h3>
      <button className="btn" onClick={changeTitle}>
        Change Title
      </button>
    </div>
  );
}

export default UseState;
